import React from 'react'

import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Button from 'react-bootstrap/Button';

function SignIn() {

  return (
    <Form className="d-flex">
                <Button variant="outline-primary" style={{borderTopRightRadius: '0px', borderBottomRightRadius: '0px'}}>Log In</Button>
                <Button variant="outline-primary" style={{borderTopLeftRadius: '0px', borderBottomLeftRadius: '0px'}}>Create An Account</Button>
                <InputGroup className="" controlid="formBasicEmail">
                  <Form.Control type="text" placeholder="Enter stock" maxLength="4" ref={resultsRef} onChange = {setCurrent} style={{textTransform: "uppercase", borderRadius: "0px"}} />
                  <Button variant="outline-primary" onClick = {() => {getResults();}} style={{borderRadius: "0px"}}>
                    Search
                  </Button>
                </InputGroup>
    </Form>
  )
}

export default SignIn;
